import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import * as S from "./styled";
import PostCard from "../../components/Post/PostCard/PostCard";
import Header from "../../components/common/Header/Header";
import Navbar from "../../components/common/Navbar/Navbar";
import { categories, statusOptions } from "./data";

const PostList = () => {
  const navigate = useNavigate();
  const [selectedCategory, setSelectedCategory] = useState("");
  const [selectedStatus, setSelectedStatus] = useState("");

  const handleCategoryClick = (category) => {
    setSelectedCategory(category);
  };

  const handleStatusClick = (status) => {
    setSelectedStatus(status);
  };

  const handleScrap = (postId) => {
    setPosts((prevPosts) =>
      prevPosts.map((post) =>
        post.id === postId ? { ...post, isScraped: !post.isScraped } : post
      )
    );
  };

  const [posts, setPosts] = useState([
    {
      id: 1,
      title: "삼성 냉장고 팝니다",
      price: 500000,
      imageUrl: "https://via.placeholder.com/300x200",
      isScraped: false,
      category: "냉장고",
      status: "available",
    },
    {
      id: 2,
      title: "LG 통돌이 세탁기 급처",
      price: 150000,
      imageUrl: "https://via.placeholder.com/300x200",
      isScraped: true,
      category: "세탁기",
      status: "available",
    },
    {
      id: 3,
      title: "스탠드 에어컨 판매합니다",
      price: 350000,
      imageUrl: "https://via.placeholder.com/300x200",
      isScraped: false,
      category: "에어컨",
      status: "available",
    },
    {
      id: 4,
      title: "건조기 팔아요 (2년 사용)",
      price: 400000,
      imageUrl: "https://via.placeholder.com/300x200",
      isScraped: true,
      category: "세탁기",
      status: "sold",
    },
    {
      id: 5,
      title: "삼성 비스포크 냉장고",
      price: 1200000,
      imageUrl: "https://via.placeholder.com/300x200",
      isScraped: false,
      category: "냉장고",
      status: "available",
    },
    {
      id: 6,
      title: "벽걸이 에어컨 판매",
      price: 280000,
      imageUrl: "https://via.placeholder.com/300x200",
      isScraped: false,
      category: "에어컨",
      status: "available",
    },
    {
      id: 7,
      title: "LG 트롬 세탁기",
      price: 450000,
      imageUrl: "https://via.placeholder.com/300x200",
      isScraped: true,
      category: "세탁기",
      status: "available",
    },
    {
      id: 8,
      title: "삼성 냉장고 (새제품)",
      price: 650000,
      imageUrl: "https://via.placeholder.com/300x200",
      isScraped: false,
      category: "냉장고",
      status: "available",
    },
  ]);

  const filteredPosts = posts.filter((post) => {
    const categoryMatch =
      selectedCategory === "" || selectedCategory === post.category;
    const statusMatch = selectedStatus === "" || post.status === selectedStatus;
    return categoryMatch && statusMatch;
  });

  return (
    <>
      <Header />
      <S.Container>
        <S.Header>
          <S.Title>중고 가전</S.Title>
          <S.FilterButton>필터</S.FilterButton>
        </S.Header>

        <S.CategoryContainer>
          <S.CategorySection>
            <S.CategoryTitle>카테고리</S.CategoryTitle>
            <S.CategoryList>
              {categories.map((category) => (
                <S.CategoryItem
                  key={category.id}
                  onClick={() => handleCategoryClick(category.id)}
                  $isSelected={selectedCategory === category.id}
                >
                  <S.CategoryIcon src={category.icon} alt={category.name} />
                  <S.CategoryName>{category.name}</S.CategoryName>
                </S.CategoryItem>
              ))}
            </S.CategoryList>
          </S.CategorySection>

          <S.Separator />

          <S.CategorySection>
            <S.CategoryTitle>상태</S.CategoryTitle>
            <S.CategoryList>
              {statusOptions.map((status) => (
                <S.CategoryItem
                  key={status.id}
                  onClick={() => handleStatusClick(status.id)}
                  $isSelected={selectedStatus === status.id}
                >
                  <S.CategoryIcon src={status.icon} alt={status.name} />
                  <S.CategoryName>{status.name}</S.CategoryName>
                </S.CategoryItem>
              ))}
            </S.CategoryList>
          </S.CategorySection>
        </S.CategoryContainer>

        <S.PostGrid>
          {filteredPosts.map((post) => (
            <PostCard
              key={post.id}
              {...post}
              onScrapClick={() => handleScrap(post.id)}
            />
          ))}
        </S.PostGrid>

        <S.AddButton onClick={() => navigate("/post/create")}>+</S.AddButton>
      </S.Container>
      <Navbar />
    </>
  );
};

export default PostList;
